                            var adElem = document.querySelector(".ytp-ad-player-overlay");
                            
                            if(adElem && !fastForwarding) {
                                var video = document.querySelector("video");
                                if (video) { video.currentTime = video.duration ?? 600; }
                                
                                fastForwarding = true;
                                setTimeout(function () {
                                    fastForwarding = false;
                                }, 100);
                            }

